import React, { useState, useEffect } from 'react'

import axios from 'axios'

import { Formik, Field, Form } from 'formik'

const SomeQuestions = (props) => {

    const[allData, setAllData] = useState([])
    const[filteredData, setFilteredData] = useState([])

    const fetchComplexNames = () => {
        axios.get('http://10.0.4.5:8000/api/v1/vhe/complexname').then(result => {
            const response = result.data.results
            console.log(response)
            setAllData(response)
            setFilteredData(response)
        }).catch(e => {
            console.log('Error getting data: ' + e)
        })
    }

    useEffect(() => {
        fetchComplexNames()
    }, [])

    if(!allData) return null

    return (
        <>
            <h3>Some questions</h3>
            <Formik
                initialValues={{
                    part_of_complex: '',
                    is_existing_complex: '',
                    existing_complex_name: '',
                    residence_type: '',
                    vhe_type: ''
                }}
                onSubmit={( data ) => console.log(data)}
            >
            {({
                values,
                handleChange,
                handleBlur
            }) => (
                <Form>
                    <div>Part of a complex</div>
                    <div>
                        <label>
                            <Field type='radio' name='part_of_complex' value='true' />
                            Yes
                        </label>
                        <label>
                            <Field type='radio' name='part_of_complex' value='false' />
                            No
                        </label>
                    </div>

                    {values.part_of_complex && (
                        <>
                            <div>Part of a complex</div>
                            <div>
                                <label>
                                    <Field type='radio' name='is_existing_complex' value='true' />
                                    Yes
                                </label>
                                <label>
                                    <Field type='radio' name='is_existing_complex' value='false' />
                                    No
                                </label>
                            </div>
                        </>
                    )}

                    {values.part_of_complex && values.is_existing_complex && (
                        <>
                            <label htmlFor='existing_complex_name' style={{ display: 'block' }}>
                                Complex name
                            </label>
                            <select
                                name='existing_complex_name'
                                value={values.existing_complex_name}
                                onChange={handleChange}
                                onBlur={handleBlur}
                                style={{ display: 'block' }}
                            >
                                {allData.map((item, index) => (
                                    <option key={index} value={item.value} label={item.label} />
                                ))}
                            </select>
                        </>
                    )}

                    <label htmlFor='residence_type' style={{ display: 'block' }}>
                        Complex name
                    </label>
                    <select
                        name='residence_type'
                        value={values.residence_type}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        style={{ display: 'block' }}
                    >
                        {residenceTypes__array.map((item, index) => (
                            <option key={index} value={item.value} label={item.label} />
                        ))}
                    </select>

                    <label htmlFor='vhe_type' style={{ display: 'block' }}>
                        Complex name
                    </label>
                    <select
                        name='vhe_type'
                        value={values.vhe_type}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        style={{ display: 'block' }}
                    >
                        {livingPlaceTypes__array.map((item, index) => (
                            <option key={index} value={item.value} label={item.label} />
                        ))}
                    </select>

                    <button type='submit'>Submit</button>
                </Form>
            )}
            </Formik>
        </>
    )
}

const existingComplexes__array = [
    {
        value: '1',
        label: 'Complex 1'
    },
    {
        value: '2',
        label: 'Complex 2'
    },
    {
        value: '3',
        label: 'Complex 3'
    },
    {
        value: '4',
        label: 'Complex 4'
    }
]

const residenceTypes__array = [
    {
        value: '1',
        label: 'Apartment'
    },
    {
        value: '2',
        label: 'House'
    },
    {
        value: '3',
        label: 'Mobil home'
    },
    {
        value: '4',
        label: 'Studio'
    }
]

const livingPlaceTypes__array = [
    {
        value: '1',
        label: 'Bed'
    },
    {
        value: '2',
        label: 'Room'
    },
    {
        value: '3',
        label: 'Residence'
    }
]

export default SomeQuestions
